import React from 'react';

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./pages/aboutUs"
import './App.css';
import aboutUs from './pages/aboutUs';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact component={aboutUs} />

      </Switch>
    </Router>
  );
}

export default App;
